import React, { Component } from 'react';
import RecipeList from "../components/RecipeList";
import Search from "../components/Search";

class Recipes extends Component {
    render() {
        return (
            <h4>
                Hello from recpies
                <Search></Search>
                <RecipeList></RecipeList>
                
            </h4>
        );
    }
}

export default Recipes;
